##################################################","##","## load \"Sim.DiffProc\" package and others packages","","if (!require(\"Sim.DiffProc\")) {","    install.packages(\"Sim.DiffProc\")","    library(\"Sim.DiffProc\")","}","","if (!require(\"yuima\")) {","  install.packages(\"yuima\")","  library(\"yuima\")","}","","if (!require(\"ttutils\")) {","    install.packages(\"ttutils\")","    library(\"ttutils\")","}","","if (!require(\"EQL\")) {","    install.packages(\"EQL\")","    library(\"EQL\")","}","","if (!require(\"gsl\")) {","    install.packages(\"gsl\")","    library(\"gsl\")","}","","if (!require(\"ggsci\")) {","    install.packages(\"ggsci\")","    library(\"ggsci\")","}","","if (!require(\"furrr\")) {","    install.packages(\"furrr\")","    library(\"furrr\")","}","","options(future.globals.maxSize = +Inf)","","###########################################","### Simulation model Eq.(1): R function ###","###########################################","","####################","## A: alpha","## B: beta","## G: gamma","## g_t: g(t)","####################","## ncpu: number of CPU cores","####################","","Sim_mod <- function(x0,gt,k=NULL,Alpha=1,Beta=1,Gamma=1,H=0.75,","                    T=1,N=1000,M=100,ncpu=4)","           {","   if (H <= 0) stop(\"'H' must be in '[0 . 1]'\")","   if (H >= 1) stop(\"'H' must be in '[0 . 1]'\")","   if (Gamma <= 0) stop(\"'Gamma' must be numeric > 0\")","   if (!is.expression(gt)) stop(\" 'g(t)' must be expressions in 't'\")","   samp <- yuima::setSampling(Terminal=T, n=N)","   cl <- parallel::makeCluster(ncpu)","   parallel::clusterEvalQ(cl, library(yuima))","   parallel::clusterExport(cl, varlist = c(\"H\"))","   W_h <- parallel::parSapply(cl,1:M,function(i) ","             yuima::simulate(yuima::setModel(drift = 0, diffusion = 1 ,solve.var = \"x\"),","             hurst = H, sampling = yuima::setSampling(Terminal=T, n=N))@data@original.data)","   parallel::stopCluster(cl)","   temps <- samp@grid[[1]]  ","   if (is.null(k)){ Gt <- gt}else{","   if (ttutils::isInteger(k)==FALSE) stop(\"k must be non-negative integer.\")","   Gt  <- Deriv::Deriv(gt,\"t\",nderiv = k)}","   G_t  <- function(t) eval(Gt)","   X <- (G_t(temps))^(Alpha)*(x0*G_t(0)^(-Alpha)+Beta*temps+Gamma*W_h)","   name <- \"X\"","   name <- if(M > 1) paste(\"X\",1:M,sep=\"\")","   X <- ts(X, start = 0, deltat = samp@delta, names=name)","   return(invisible(X))","}","","","###########################################","###       Empirical moments             ###","###########################################","","moment <- function(x, order = 1,center = TRUE,...)","{","  if (!is.numeric(x)) ","    stop(\"argument 'x' must be numeric\")","  x = x[!is.na(x)]","  if (center) x <- x - mean(x)","  return(sum(x^order)/length(x))","}","","###################################################","###      Exact moments Eq.(5): R function       ###","###################################################","","HO_mom <- function(x0,gt,k=NULL,Alpha=1,Beta=1,Gamma=1,H=0.75,p=1,t)","        {","    t0 <- t[which(t==0)]","    t  <- t[which(t!=0)]","    if (H <= 0) stop(\"'H' must be in '[0 . 1]'\")","    if (H >= 1) stop(\"'H' must be in '[0 . 1]'\")","    if (p <= 0) stop(\"'p' must be numeric > 0\")","    if (Gamma <= 0) stop(\"'Gamma' must be numeric > 0\")","    if (!is.expression(gt)) stop(\" 'g(t)' must be expressions in 't'\")","    if (is.null(k)){Gt <- gt}else{","    if (ttutils::isInteger(k)==FALSE) stop(\"k must be non-negative integer.\")","    Gt  <- Deriv::Deriv(gt,\"t\",nderiv = k)}","    G_t <- function(t) eval(Gt)","    A   <- function(t) 2^(-0.5*p)*((Gamma*G_t(t)^(Alpha))/1i)^p * t^(H*p)","    B   <- function(t) 0.5*sqrt(2)*1i *((G_t(0)^(-Alpha)*x0+Beta*t )/Gamma)*t^(-H)            ","    if (ttutils::isInteger(p)){","          Herm     <- EQL::hermite(x=B(t),n=p,prob=FALSE)}else{","          M1 <- gsl::hyperg_1F1(a=-0.5*p,b=0.5, x=B(t)^2)","          M2 <- gsl::hyperg_1F1(a=0.5-0.5*p,b=1.5, x=B(t)^2)","          Herm  <- 2^(p)*sqrt(pi)*((M1/gamma(0.5-0.5*p))-2*B(t)*(M2/gamma(-0.5*p)))  ","      }","    result <- Re(A(t)*Herm)","    if (length(t0)==1 & t0==0) {result <- c(x0^p,result)} else { result <- result}","    return(invisible(result))","}"],"stylingDirectives":[[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":70,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[{"start":0,"end":50,"cssClass":"pl-c"},{"start":0,"end":1,"cssClass":"pl-c"}],[],[{"start":0,"end":2,"cssClass":"pl-k"},{"start":4,"end":5,"cssClass":"pl-k"},{"start":13,"end":27,"cssClass":"pl-s"},{"start":13,"end":14,"cssClass":"pl-pds"},{"start":26,"end":27,"cssClass":"pl-pds"}],[{"start":21,"end":35,"cssClass":"pl-s"},{"start":21,"end":22,"cssClass":"pl-pds"},{"start":34,"end":35,"cssClass":"pl-pds"}],[{"start":12,"end":26,"cssClass":"pl-s"},{"start":12,"end":13,"cssClass":"pl-pds"},{"start":25,"end":26,"cssClass":"pl-pds"}],[],[],[{"start":0,"end":2,"cssClass":"pl-k"},{"start":4,"end":5,"cssClass":"pl-k"},{"start":13,"end":20,"cssClass":"pl-s"},{"start":13,"end":14,"cssClass":"pl-pds"},{"start":19,"end":20